import { useEffect, useState } from "react";
import { PageList } from "../types/PageList";
import { deleteTrack, fetchTracks } from "../api/track/trackApi";
import { CreateTrackModal } from "../components/createTrackForm/CreateTrackModal";
import { TrackList } from "../components/TrackList/TrackList";
import { Track } from "../api/track/models/Track";
import { GetModel } from "../api/track/models/CreateTrack";
import { Box, Typography, Button, Paper } from "@mui/material";
import { SearchAppBar } from "../components/SeachBar/SearchBar";
import TablePagination from "@mui/material/TablePagination";
import LibraryMusicIcon from "@mui/icons-material/LibraryMusic";
import { TrackFilterBar } from "../components/TrackFilterSortBar/TrackFilterBar";

const model: GetModel = {
  page: 1,
  limit: 10,
  order: "",
  sort: "",
  genre: "",
  artist: "",
  search: "",
};

export const HomePage = () => {
  const [tracks, setTracks] = useState<PageList<Track>>();
  const [showModal, setShowModal] = useState(false);

  const handleTrackCreated = (newTrack: Track) => {
    if (tracks) {
      setTracks({
        ...tracks,
        data: [newTrack, ...tracks.data],
      });
    }
  };

  useEffect(() => {
    const fetch = async () => {
      const tracks = await fetchTracks(model);

      if (tracks) {
        setTracks(tracks);
      }
    };

    fetch();
  }, []);

  const handleTrackDelete = async (trackId: string) => {
    try {
      await deleteTrack({ id: trackId });
      setTracks((prev) =>
        prev
          ? { ...prev, data: prev.data.filter((track) => track.id !== trackId) }
          : prev
      );
    } catch (error) {
      console.error(error);
    }
  };

  const handleTrackUpdated = (updatedTrack: Track) => {
    setTracks((prev) =>
      prev
        ? {
            ...prev,
            data: prev.data.map((t) =>
              t.id === updatedTrack.id ? updatedTrack : t
            ),
          }
        : prev
    );
  };
  const [page, setPage] = useState(0);
  const [rowsPerPage, setRowsPerPage] = useState(10);

  const handleChangePage = (
    event: React.MouseEvent<HTMLButtonElement> | null,
    newPage: number
  ) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (
    event: React.ChangeEvent<HTMLInputElement | HTMLTextAreaElement>
  ) => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0);
  };

  useEffect(() => {
    const fetch = async () => {
      const tracks = await fetchTracks({
        ...model,
        page: page + 1,
        limit: rowsPerPage,
      });

      if (tracks) {
        setTracks(tracks);
      }
    };
    fetch();
  }, [page, rowsPerPage]);

  return (
    <Box
      sx={{
        minHeight: "100vh",
        background:
          "linear-gradient(160deg, #ff758c 0%, #ff7eb3 50%, #ffa8c5 100%)",
        padding: { xs: "24px", sm: "48px" },
        fontFamily: "'Inter', sans-serif",
      }}
    >
      {/* Header */}
      <Paper
        elevation={0}
        sx={{
          display: "flex",
          flexDirection: { xs: "column", sm: "row" },
          alignItems: "center",
          justifyContent: "space-between",
          padding: { xs: "20px", sm: "28px 40px" },
          borderRadius: "16px",
          background: "#ffffff",
          mb: 3,
          boxShadow: "0 4px 16px rgba(255, 117, 140, 0.12)",
        }}
      >
        <Box
          sx={{
            display: "flex",
            alignItems: "center",
            gap: 2,
            mb: { xs: 2, sm: 0 },
          }}
        >
          <Box
            sx={{
              width: 48,
              height: 48,
              borderRadius: "12px",
              background: "linear-gradient(135deg, #ff758c, #ff7eb3)",
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
            }}
          >
            <Music size={24} color="#fff" />
          </Box>
          <Box>
            <Typography
              variant="h5"
              sx={{
                fontWeight: 700,
                color: "#1a1a1a",
                fontSize: { xs: "1.4rem", sm: "1.6rem" },
              }}
            >
              Track Manager
            </Typography>
            <Typography
              variant="body2"
              sx={{
                color: "#666",
                fontSize: "0.9rem",
              }}
            >
              Керуйте вашою музичною колекцією
            </Typography>
          </Box>
        </Box>

        <Button
          variant="contained"
          onClick={() => setShowModal(true)}
          sx={{
            background: "linear-gradient(135deg, #ff758c, #ff7eb3)",
            fontWeight: 600,
            borderRadius: "12px",
            px: 3,
            py: 1.5,
            textTransform: "none",
            fontSize: "0.95rem",
            boxShadow: "0 4px 12px rgba(255, 117, 140, 0.3)",
            "&:hover": {
              background: "linear-gradient(135deg, #ff6a7f, #ff72a9)",
              boxShadow: "0 6px 16px rgba(255, 117, 140, 0.4)",
            },
          }}
        >
          + Додати трек
        </Button>
      </Paper>

      {/* Search and Filter */}
      <Box
        sx={{
          display: "flex",
          flexDirection: { xs: "column", md: "row" },
          gap: 2,
          mb: 3,
        }}
      >
        <Paper
          elevation={0}
          sx={{
            flex: 1,
            padding: "20px",
            borderRadius: "16px",
            background: "#ffffff",
            boxShadow: "0 4px 16px rgba(255, 117, 140, 0.12)",
          }}
        >
          <Typography sx={{ color: "#666" }}>Пошук треків...</Typography>
        </Paper>

        <Paper
          elevation={0}
          sx={{
            width: { xs: "100%", md: "auto" },
            minWidth: { md: 140 },
            borderRadius: "16px",
            padding: "16px 24px",
            background: "#ffffff",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            boxShadow: "0 4px 16px rgba(255, 117, 140, 0.12)",
          }}
        >
          <Typography sx={{ color: "#666", fontWeight: 500 }}>
            Фільтр
          </Typography>
        </Paper>
      </Box>

      {/* Empty State */}
      {tracks?.data.length === 0 ? (
        <Paper
          elevation={0}
          sx={{
            padding: 8,
            borderRadius: "16px",
            background: "#ffffff",
            textAlign: "center",
            boxShadow: "0 4px 16px rgba(255, 117, 140, 0.12)",
          }}
        >
          <Typography
            variant="h6"
            sx={{
              color: "#999",
              fontWeight: 500,
              mb: 1,
            }}
          >
            Треків поки немає
          </Typography>
          <Typography
            variant="body1"
            sx={{
              color: "#bbb",
            }}
          >
            Додайте перший трек, щоб почати 🎵
          </Typography>
        </Paper>
      ) : null}

      {/* Pagination */}
      <Box sx={{ display: "flex", justifyContent: "center", mt: 4 }}>
        <Paper
          elevation={0}
          sx={{
            borderRadius: "16px",
            background: "#ffffff",
            boxShadow: "0 4px 16px rgba(255, 117, 140, 0.12)",
            overflow: "hidden",
          }}
        >
          <TablePagination
            component="div"
            count={tracks?.meta.total || 0}
            page={page}
            onPageChange={handleChangePage}
            rowsPerPage={rowsPerPage}
            onRowsPerPageChange={handleChangeRowsPerPage}
            sx={{
              "& .MuiTablePagination-selectLabel, & .MuiTablePagination-displayedRows":
                {
                  color: "#666",
                  fontWeight: 500,
                },
              "& .MuiIconButton-root": {
                color: "#ff758c",
                "&:hover": {
                  background: "rgba(255, 117, 140, 0.08)",
                },
                "&.Mui-disabled": {
                  color: "#ddd",
                },
              },
            }}
          />
        </Paper>
      </Box>
    </Box>
  );
};
